pragma solidity ^0.8.9;

import '@chainlink/contracts/src/v0.8/AutomationCompatible.sol';
import '@chainlink/contracts/src/v0.8/ChainlinkClient.sol';
import '@chainlink/contracts/src/v0.8/ConfirmedOwner.sol';
import '@openzeppelin/contracts/utils/Strings.sol';

contract Lazymint is
    AutomationCompatibleInterface,
    ChainlinkClient,
    ConfirmedOwner
{
    using Chainlink for Chainlink.Request;

    uint256 public volume;
    bytes32 private jobId;
    uint256 private fee;
    bool public approved;
    string public urlTest;

    event RequestVolume(
        bytes32 indexed requestId,
        bool approved,
        string lastChecked
    );
    uint256 public counter;

    /**
     * Use an interval in seconds and a timestamp to slow execution of Upkeep
     */
    uint256 public immutable interval;
    uint256 public lastTimeStamp;

    address[] public addressesToVerify;

    mapping(address => bool) public watchers;
    mapping(bytes32 => address) private responseID;

    constructor(uint256 updateInterval) ConfirmedOwner(msg.sender) {
        setChainlinkToken(0xf97f4df75117a78c1A5a0DBb814Af92458539FB4);
        setChainlinkOracle(0xCC79157eb46F5624204f47AB42b3906cAA40eaB7);
        jobId = 'c1c5e92880894eb6b27d3cae19670aa3';
        fee = (1 * LINK_DIVISIBILITY) / 10; // 0,1 * 10**18 (Varies by network and job)
        interval = updateInterval;
        lastTimeStamp = block.timestamp;
        counter = 0;
    }

    function checkUpkeep(
        bytes calldata /* checkData */
    )
        external
        view
        override
        returns (
            bool upkeepNeeded,
            bytes memory /* performData */
        )
    {
        upkeepNeeded = (block.timestamp - lastTimeStamp) > interval;
        // We don't use the checkData in this example. The checkData is defined when the Upkeep was registered.
    }

    function addWatcher() public {
        watchers[msg.sender] = true;
        addressesToVerify.push(msg.sender);
    }

    function performUpkeep(
        bytes calldata /* performData */
    ) external override {
        //We highly recommend revalidating the upkeep in the performUpkeep function
        if ((block.timestamp - lastTimeStamp) > interval) {
            lastTimeStamp = block.timestamp;
            counter = counter + 1;
            batchVerify();
        }

        // We don't use the performData in this example. The performData is generated by the Automation Node's call to your checkUpkeep function
    }

    string public lastChecked;

    function batchVerify() public {
        for (uint256 i = 0; i < addressesToVerify.length; i++) {
            address currentWallet = addressesToVerify[i];
            requestVolumeData(currentWallet);
        }
    }

    function toAsciiString(address x) internal pure returns (string memory) {
        bytes memory s = new bytes(40);
        for (uint256 i = 0; i < 20; i++) {
            bytes1 b = bytes1(uint8(uint256(uint160(x)) / (2**(8 * (19 - i)))));
            bytes1 hi = bytes1(uint8(b) / 16);
            bytes1 lo = bytes1(uint8(b) - 16 * uint8(hi));
            s[2 * i] = char(hi);
            s[2 * i + 1] = char(lo);
        }
        return string(s);
    }

    function char(bytes1 b) internal pure returns (bytes1 c) {
        if (uint8(b) < 10) return bytes1(uint8(b) + 0x30);
        else return bytes1(uint8(b) + 0x57);
    }

    function uintToString(uint256 _value) public pure returns (string memory) {
        bytes32 _bytes = bytes32(_value);
        bytes memory HEX = '0123456789abcdef';
        bytes memory _string = new bytes(42);
        _string[0] = '0';
        _string[1] = 'x';
        for (uint256 i = 0; i < 20; i++) {
            _string[2 + i * 2] = HEX[uint8(_bytes[i + 12] >> 4)];
            _string[3 + i * 2] = HEX[uint8(_bytes[i + 12] & 0x0f)];
        }
        return string(_string);
    }

    function buildUrl(address _wallet) internal pure returns (string memory) {
        return
            string.concat(
                'https://lazymint-chainlink.vercel.app/api/poap?address=0x',
                toAsciiString(_wallet)
            );
    }

    function removeAddress(uint256 index) internal {
        if (index >= addressesToVerify.length) return;

        addressesToVerify[index] = addressesToVerify[
            addressesToVerify.length - 1
        ];
        addressesToVerify.pop();
    }

    function buidl(address _wallet) public {
        string memory url = buildUrl(_wallet);
        urlTest = url;
    }

    function requestVolumeData(address _wallet)
        public
        returns (bytes32 requestId)
    {
        Chainlink.Request memory req = buildChainlinkRequest(
            jobId,
            address(this),
            this.fulfill.selector
        );
        string memory url = buildUrl(_wallet);
        // Set the URL to perform the GET request on
        req.add('get', url);
        req.add('path', 'success');
        // Sends the request
        //todo add sendChainlinkRequest(req, fee) and wallet addy to mapping
        bytes32 response = sendChainlinkRequest(req, fee);
        responseID[response] = _wallet;
        emit RequestVolume(jobId, true, url);
        return response;
    }

    function fulfill(bytes32 _requestId, bool _approved)
        public
        recordChainlinkFulfillment(_requestId)
    {
        address mintTo = responseID[_requestId];
        if (_approved = true) {
            execute(mintTo);

            for (uint256 i = 0; i < addressesToVerify.length; i++) {
                if (mintTo == addressesToVerify[i]) {
                    removeAddress(i);
                }
            }
        }
        emit RequestVolume(_requestId, _approved, lastChecked);
    }

    function execute(address account) internal virtual {}

    /**
     * Allow withdraw of Link tokens from the contract
     */
    function withdrawLink() public onlyOwner {
        LinkTokenInterface link = LinkTokenInterface(chainlinkTokenAddress());
        require(
            link.transfer(msg.sender, link.balanceOf(address(this))),
            'Unable to transfer'
        );
    }
}
